WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Hej!

WordPress har inbyggd funktion som kan upptäcka när något tillägg eller tema orsakar ett allvarligt fel på din webbplats och informerar dig via detta e-postmeddelande som skickas automatiskt.
###CAUSE###
Börja med att besöka din webbplats (###SITEURL###) och kontrollera om du märker några synliga problem. Därefter går du till sidan där problemet inträffade (###PAGEURL###) för att kontrollera om du ser något där.

###SUPPORT###

Om det skulle se ut som om webbplatsen inte fungerar och du inte kommer åt adminpanelen som du borde, har WordPress nu ett speciellt ”räddningsläge”. Det låter dig på ett säkert sätt logga in i adminpanelen för att undersöka problemet vidare.

###LINK###

För att inte äventyra säkerheten på din webbplats kommer denna länk att gälla endast ###EXPIRES###. Oroa dig inte över detta. Om felet skulle inträffa igen efter det kommer du att få ett nytt e-postmeddelande med en ny länk.

Om du ber om hjälp med detta problem kan du bli ombedd att uppge en del av nedanstående information:
