###SITEURL###','Only UUID V4 is supported at this time.'=>'För närvarande stöds endast UUID V4.','The Press This plugin is required.'=>'Tillägget Blogga detta krävs.','%s themes'=>'%s teman','Filter themes (%s)'=>'Filtrera teman (%s)','Go to theme sources'=>'Gå till tema-källor','Search WordPress.org themes'=>'Sök teman på WordPress.org','Install &amp; Preview'=>'Installera och förhandsgranska','Invalid URL.'=>'Ogiltig URL.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Nu är det dags att lägga in några länkar! Klicka på ”%s” för att lägga till sidor, kategorier och anpassade länkar i din meny. Lägg till så många du känner för.','Choose image'=>'Välj bild','Choose audio'=>'Välj ljud','Change audio'=>'Byt ut ljud','Select audio'=>'Välj ljud','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klicka på ”Lägg till ny bild” för att ladda upp en bildfil från din dator. Ditt tema fungerar bäst med en sidhuvudsbild som är %s pixlar hög – När du har laddat upp bilden kommer du att kunna beskära den så att den passar perfekt.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klicka på ”Lägg till ny bild” för att ladda upp en bildfil från din dator. Ditt tema fungerar bäst med en sidhuvudsbild som är %s pixlar bred – När du har laddat upp bilden kommer du att kunna beskära den så att den passar perfekt.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once