s platser.','Your theme can display menus in one location.'=>'Ditt tema kan visa menyer på en plats.','CSS code'=>'CSS-kod','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Redigeringsfältet markerar automatiskt syntax i kod. Du kan inaktivera detta i din <a href="%1$s" %2$s>användarprofil%3$s</a> för att arbeta i ”oformaterad text”-läget.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Du som använder skärmläsare: När du befinner dig i formulärläge kan du behöva trycka två gånger på Esc-tangenten.','To move away from this area, press the Esc key followed by the Tab key.'=>'Navigera från detta område genom att trycka på Esc och därefter på Tab.','In the editing area, the Tab key enters a tab character.'=>'I redigeringsområdet matar tab-tangenten in ett tabulatortecken.','When using a keyboard to navigate:'=>'När ett tangentbord används för navigering:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Lägg till din egen CSS-kod här för att anpassa din webbplats utseende och layout.','Your homepage displays'=>'Din startsida visar','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Du kan välja vad som visas på startsidan för din webbplats. Det kan vara blogginlägg i omvänd kronologisk ordning (klassisk blogg) eller en statisk sida. För att ange en statisk sida behöver du först skapa två sidor. Den ena kommer att användas som startsida och på den andra sidan kommer dina blogginlägg att visas.','Homepage Settings'=>'Inställningar för startsida','WordPress.org themes'=>'Teman på WordPress.org','Installed themes'=>'Installerade teman','Publish Se